description:
Slender Man is back in this all new sequel to the indie mobile hit game Slender Man Chapter 1:Alone. Can you stand the suspense as Slender Man stalks you through 3 all new terrifying, 3D levels? 

He got some new surprises in store that are sure to make you scream. Beware, this is not an easy game.

